@-moz-document domain("dynalist.io") {
/* smaller space at the bottom - was 300px */
.Document-bottomSpace {
	min-height: 100px;
}

/* line under non-empty children-list */
.Node-children:not(:empty) {    
    /*max-width:96%;*/
	padding-bottom: 3px;
    margin-bottom: 6px;
    border-left: 1px solid rgba(180, 151, 80, 0.3);
}
    
