*/

.is-article-view .Node-children:not(:empty) {
    border-left: 3px solid rgba(180, 151, 80, 0.1);
	border-radius: 16px 0px 0px 40px;
    /*padding-left: 0px;*/
    /*padding-top: 20px!important;*/
}

/* no line under root's children (end of doc) */
/* in "article view" no line at all under children */      /* article-view changed to is-article-view --- not uploaded */
.Node.is-currentRoot > .Node-children,
.is-article-view .Node-children {
    border-bottom: none;
    border-left: none;
}

/* bullets general */
.Node-bullet:before {
    top: 0px;
    font-size: 10px;
    opacity:0.4; /* changed: was 0.7 */
    content: none;
}

/* bullet for expanded item */
.is-parent .Node-bullet:before {
	content: '\e90a'; /* triangle down */
}

/* bullet for collapsed item */
.Node-self.is-collapsed.is-parent > .Node-bullet:before {
	content: '\e907'; /* triangle right */
}

/* in "article view" show special bullet for collapsed items only (invisible children) */
.is-article-view .Node-self.is-collapsed.is-parent > .Node-bullet:before {
    visibility: visible;
	content: '\e914'; /* [...]-icon like for the note */
}

