.Node-noteContainer {
    background-color: rgba(180, 151, 80, 0.05);
    padding: 10px 10px 10px 10px;
}

.Node-contentContainer.mod-color-label-1 ~ div {
    background-color: rgba(249, 208, 196, 0.4);
    padding: 6px 6px 6px 6px;
}
.Node-contentContainer.mod-color-label-2 ~ div {
    background-color: rgba(254, 216, 174, 0.4);
    padding: 6px 6px 6px 6px;
}
.Node-contentContainer.mod-color-label-3 ~ div {
    background-color: rgba(254, 242, 192, 0.4);
    padding: 6px 6px 6px 6px;
}
.Node-contentContainer.mod-color-label-4 ~ div {
    background-color: rgba(200, 227, 192, 0.4);
    padding: 6px 6px 6px 6px;
}
.Node-contentContainer.mod-color-label-5 ~ div {
    background-color: rgba(197, 222, 245, 0.4);
    padding: 6px 6px 6px 6px;
}
.Node-contentContainer.mod-color-label-6 ~ div {
    background-color: rgba(212, 197, 249, 0.4);
    padding: 6px 6px 6px 6px;
}

/* ♥  ❤ */
/* .Node-contentContainer.mod-color-label-1 .Node-content:after {  */                                   /* .Node-content:after changed to .Node-renderedContent :last-child:after --- not uploaded */
.Node-contentContainer.mod-color-label-1 .Node-renderedContent :last-child:after {
    content: " ❤ ";
    font-size: 20px;
    line-height: 0;
    vertical-align: -1px;
    color: red;
}
.Node-contentContainer.has-color.mod-color-label-2 .Node-renderedContent :last-child:after {
    content: " !!!! ";
    font-style: italic;
    font-weight: bolder;
    font-size: 18px;
    line-height: 0;
    vertical-align: -1px;
    color: red;
}
.Node-contentContainer.mod-color-label-3 .Node-renderedContent :last-child:after {
    content: " ★ ";
    font-size: 20px;
    line-height: 0;
    vertical-align: -1px;
    color: darkorange;
}

